import { createStyles, makeStyles, Theme } from '@material-ui/core';
import React from 'react'

const useStyles = makeStyles((theme: Theme) => {
    createStyles({
        chips: {
            display: 'flex',
            flexWrap: 'wrap',
            justifyContent: 'center',
            '& > *': {
                margin: theme.spacing(0.5),
            },
        }
    })
})

export default function SkillsListItem(skills: string[]) {

    const [open, setOpen] = React.useState(true)

    const handleClick = () => {
        setOpen(!open);
    }

    return (
        <div >
            <ListItem button onClick={handleClick} >
                <ListItemText primary="Programming languages"></ListItemText>
                {open ? <ExpandLess /> : <ExpandMore />}
            </ListItem>

            {open ? <ListItem className={classes.chips}>
                <Chip label="Kotlin"></Chip>
                <Chip label="Java"></Chip>
                <Chip label="C++"></Chip>
                <Chip label="C#"></Chip>
                <Chip label="TypeScript"></Chip>
            </ListItem> : <div></div>}
        </div>
    )


}
